import React from "react";
import NavBar from "../components/NavBar";

const Home = () => {
  return (
    <>
      <NavBar />
      <section className="mx-4">
        <h1 className="text-[2.5em] uppercase text-center font-semibold">
          Web Developer
          <br /> & UI Designer
        </h1>
        <p>
          Hello, je suis Alexis. Designer UI/Développeur Front-End, j’aime
          imaginer, concevoir et intégrer des interfaces qui apporte des
          émotions, une satisfaction et une utilité aux utilisateurs personnes.
        </p>
      </section>
    </>
  );
};

export default Home;
